// src/components/AboutMe.js
import React from 'react';
import '../styles/AboutMe.css';

const AboutMe = () => {
    return (
        <section id="about" className="about">
            <h2>About Me</h2>
            <p>
                I'm Udhaya Kumar A, a final-year Computer Science Engineering student at Anna University, Chennai. My passion lies in the fusion of artificial intelligence, data science, and real-world problem-solving. My notable achievements include:
            </p>
            <ul className="about__achievements">
                <li>Developed an AI-based atmospheric model integrating real-time satellite and ground data to track pollutants effectively.</li>
                <li>Created a multi-modal gunshot detection system with AI, selected for the prestigious Smart India Hackathon.</li>
                <li>Completed professional data science and software development projects, employing ML models like TfidfVectorizer and MultiOutputClassifier.</li>
                <li>Served as a Campus Ambassador for TCS, leading tech outreach and promoting leadership within the academic community.</li>
                <li>Led a research project at Saveetha Medical College focused on simulating brain plasticity in adaptive AI models.</li>
            </ul>
            <p>
                My goal is to continue learning and growing in the fields of AI and software engineering, aiming to leverage my skills to make impactful contributions.
            </p>
        </section>
    );
};

export default AboutMe;
